import React from 'react';

const Cards = ({card}) => {
    return (
        <div  >
            <h3>{card.title}</h3>
           <ul>{card.url}</ul>
           <iframe
            width="560" 
            height="315" 
            src={card.url} 
            title={card.url}
             frameborder="0" 
             allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen>
             </iframe>
          
            

            
        </div>
    );
}

export default Cards;
